function (source, filterVersion) {
  console.log(source);
  let output = [];
  if (!filterVersion) {
    return source;
  } else {
    for (let i = 0; i < source.length; i++) {
      console.log(`Source [${i + 1}]`);
      let checkFilter = true;
      if (filterVersion.createDateStart !== "" && !PageLogic.CheckDateStart(source[i].created_at, filterVersion.createDateStart)) {
        console.log("false : createStart");
        checkFilter = false;
      }
      if (filterVersion.createDateEnd !== "" && !PageLogic.CheckDateEnd(source[i].created_at, filterVersion.createDateEnd)) {
        console.log("false : createEnd");
        checkFilter = false;
      }
      if (filterVersion.effectiveDateStart !== "" && !PageLogic.CheckDateStart(source[i].effective_date, filterVersion.effectiveDateStart)) {
        console.log("false : effectiveStart");
        checkFilter = false;
      }
      if (filterVersion.effectiveDateEnd !== "" && !PageLogic.CheckDateEnd(source[i].effective_date, filterVersion.effectiveDateEnd)) {
        console.log("false : effectiveEnd");
        checkFilter = false;
      }
      if (checkFilter) {
        output.push(source[i]);
      }
    }
  }
  console.log(output);
  return output;
}
